} 
/* Handle */
::-webkit-scrollbar-thumb {
  background: #ff6f002b; 
  border-radius: 10px;
  background-image: linear-gradient(-182deg, #eb14140f, #eb8d1417, #eaeb1414);
  background-repeat: no-repeat;
  background-position: center;
}
/* Handle on hover */
::-webkit-scrollbar-thumb:hover {
  background: #b3000045;
